// Complete the isValid function below.
function isValid(string) {
    var charObj = {};
    var countObj = {};
    var retAns = 'YES';
    var finalArray = [];

    for(var i=0; i<string.length; i++){
        if(charObj[string[i]]){
            charObj[string[i]]++;
        }
        else{
            charObj[string[i]] = 1;
        }
    }

    finalArray = Object.values(charObj).sort((a, b) => a-b);

    for(var i=1; i<finalArray.length; i++){
        if(finalArray[i] !== finalArray[i-1]){
            if(i+1 == finalArray.length || i == 1){
                if(finalArray[i] - finalArray[i-1] == 1){
                    retAns = 'YES';
                }
                else if(finalArray[i-1] == 1){
                    retAns = 'YES';
                }
                else{
                    retAns = 'NO';
                }
            }
            else{
                retAns = 'NO';
            }
        }
    }

    return retAns;
}

